import React from "react";
import './App.css';
import  NavBar from './components/NavBar';
import Footer from './components/Footer';
import Home from './components/Home';
import Skills from './components/Home';
import Projects from './components/Home';
import {
  BrowserRouter as Router,
  Routes,
  Route,
} from "react-router-dom";

export default function App() {
  return (
    <Router>
      <div id="app-container">
        <NavBar />
        <main id="content-wrap">
          <Routes>
            <Route exact path="/home" element={<Home />} />
            <Route exact path="/home/nymoe/github/responsive-portfolio/portfolio/src/components/Skills.js" element={<Skills />} />
            <Route exact path="/home/nymoe/github/responsive-portfolio/portfolio/src/components/Projects.js" element={<Projects />} />
          </Routes>
        </main>
        <Footer />
      </div>
    </Router>
   
  );
}
